////////////////////////////////////////////////////////////////////// Framework
//------------------------------------------------------------------------------
// Get a single DOM element by its id or multiple elements by class name
function E(id) { return document.getElementById(id); }
function cE(className) { return document.getElementsByClassName(className); }
function tE(tagName) { return document.getElementsByTagName(tagName); }
// Dimensions of the inner window (width and height)
var w = {};
function getWindowDimensions() { w['Height'] = window.innerHeight; w['Width'] = window.innerWidth; }
// Add and Remove a class from an item
function addC(item, className) { item.classList.add(className) }
function remC(item, className) { item.classList.remove(className) }
// Adds and Removes a class with a time-delay
function delayAddC(item, className, delay) { var timeout = window.setTimeout(function() { addC(item, className); }, delay); }
function delayRemC(item, className, delay) { var timeout = window.setTimeout(function() { remC(item, className); }, delay); }

// Get attributes prefixed with 'data'
function gA(item, att) { return item.getAttribute('data-'+att+''); }
function sA(item, att, set) { item.setAttribute('data-'+att+'', set); }

////////////////////////////////////////////////////////// Initialize Soundcloud
//------------------------------------------------------------------------------
function soundcloudINIT () {
  var iframe = E('playerIframe')
  if (iframe) {
    var player = SC.Widget(iframe)
    var panelBio = cE('bio-panel')[0]
    var panelPlayer = cE('player-panel')[0]
  }
  var playerContainer = E('player')
  var prevB = E('prevB')
  var nextB = E('nextB')
  var playB = E('playB')
  var pauseB = E('pauseB')
  var seekCurrent = E('seek-current')
  var seekEnd = E('seek-end')
  var seekBarContainer = E('player-seek-bar-container')
  var seekBar = E('player-seek-bar')
  var songTitle = E('song-title')
  var playerThumbnail = E('player-thumbnail')
  var tracklist = E('player-tracklist')
  var tracklistExpandButton = E('player-tracklist-expand')
  var tracklistHeight = 0
  var songList = null
  var currentSong = null
  var songDuration = null
  var seekInterval = null
  var num = 0

  function setInfo (next) {
    var interval = setInterval(() => {
      player.getSounds(response => {
        if (num < 20 && response.length > 0) {
          var artwork = response[response.length - 1].artwork_url
          if (artwork) {
            clearInterval(interval)
            songList = response
            seekInit()
            getCurrentSong(() => {
              setSongTitle()
              setArtwork()
              if (songList.length > 1) {
                buildTracklist(tracklist => { tracklistINT() })
              }
              next(true)
            })
          }
        } else if (num > 20) {
          clearInterval(interval)
        }
      })
      num++
    }, 500)
  }

  function tracklistINT (tracks) {
    var tracks = cE('track')
    if (tracklistHeight > 200) {
      remC(tracklistExpandButton, 'hidden')
      tracklist.style = 'height: 14rem;'
      tracklistExpandButton.onclick = function () {
        var expanded = gA(this, 'expanded')
        if (expanded === 'false') {
          sA(this, 'expanded', 'true')
          tracklist.style = 'height: ' + tracklistHeight + 'px;'
          tracklistExpandButton.innerHTML = 'Show Less'
        } else if (expanded === 'true') {
          sA(this, 'expanded', 'false')
          tracklist.style = 'height: 14rem;'
          tracklistExpandButton.innerHTML = 'Show More'
        }
      }
    }
    for (var i = 0, len = tracks.length; i < len; i++) {
      var track = tracks[i]
      track.onclick = function () {
        var index = parseInt(gA(this, 'index'))
        player.skip(index)
        clearSeek()
        seekInit()
        seek()
        getCurrentSong(function () {
          setSongTitle()
          togglePlayStyling('play')
          checkSongIndex()
          selectCurrentTrack(index)
        })
      }
    }
  }

  function buildTracklist (next) {
    for (var i = 0, len = songList.length; i < len; i++) {
      var song = songList[i]
      var songContainer = document.createElement('div')
      addC(songContainer, 'track')
      if (i === 0) { addC(songContainer, 'current') }
      sA(songContainer, 'index', i)
      var songTitleContainer = document.createElement('div')
      addC(songTitleContainer, 'track-title')
      var songTimeContainer = document.createElement('div')
      addC(songTimeContainer, 'track-duration')
      var minutes = Math.floor(song.duration / 60000)
      var seconds = ((song.duration % 60000) / 1000).toFixed(0)
      songTitleContainer.innerHTML = song.title
      songTimeContainer.innerHTML = minutes + ':' + (seconds < 10 ? '0' : '') + seconds
      songContainer.appendChild(songTitleContainer)
      songContainer.appendChild(songTimeContainer)
      tracklist.appendChild(songContainer)
      tracklistHeight += 40
    }
    if (next) { next() }
  }

  function getCurrentSong (next) {
    player.getCurrentSound(function (response) {
      currentSong = response
      if (next) { next(response) }
    })
  }

  function selectCurrentTrack (index) {
    var tracks = cE('track')
    for (var i = 0, len = tracks.length; i < len; i++) { remC(tracks[i], 'current') }
    addC(tracks[index], 'current')
  }

  function setSongTitle () {
    if (currentSong.title) { songTitle.innerHTML = currentSong.title }
  }

  function setArtwork () {
    if (currentSong.artwork_url) { playerThumbnail.src = currentSong.artwork_url.replace('-large', '-t500x500') }
  }

  function checkSongIndex () {
    player.getCurrentSoundIndex(function (response) {
      var num = response
      if (num === 0) { addC(prevB, 'inactive') }
      if ((num > 0) && num < songList.length - 1) { remC(prevB, 'inactive'); remC(nextB, 'inactive') }
      if (num === songList.length - 1) { addC(nextB, 'inactive') }
    })
  }

  function togglePlayStyling (state) {
    switch (state) {
      case 'play': remC(pauseB, 'hidden'); addC(playB, 'hidden'); break
      case 'pause': remC(playB, 'hidden'); addC(pauseB, 'hidden'); break
    }
  }

  function clearSeek () {
    songDuration = null
    clearInterval(seekInterval)
  }

  function formatSeekNumbers (num, state) {
    var minutes = Math.floor(num / 60000)
    var seconds = ((num % 60000) / 1000).toFixed(0)
    if (state === 'init') {
      seekCurrent.innerHTML = '0:00'
      seekEnd.innerHTML = minutes + ':' + (seconds < 10 ? '0' : '') + seconds
    } else {
      seekCurrent.innerHTML = minutes + ':' + (seconds < 10 ? '0' : '') + seconds
    }
  }

  function seekInit () {
    player.getDuration(function (num) {
      songDuration = num
      formatSeekNumbers(num, 'init')
    })
  }

  function seek () {
    seekInterval = setInterval(function () {
      player.getPosition(function (num) {
        seekBar.style.width = (Math.floor(num) / Math.floor(songDuration)) * 100 + '%'
        formatSeekNumbers(num, 'play')
      })
    }, 75)
  }

  function hidePlayer () {
    panelBio.className = 'panel bio-panel cell medium-6 large-7 medium-offset-1'
    addC(panelPlayer, 'hidden')
  }

  function seekBarINT () {
    seekBarContainer.onclick = function (e) {
      var posX = this.getBoundingClientRect().left
      var percentage = (e.pageX - posX) / this.clientWidth
      player.seekTo(songDuration * percentage)
      seek()
    }
  }

  if (iframe) {
    player.bind(SC.Widget.Events.READY, function () {
      setInfo(function (response) {
        if (response) {
          remC(playerContainer, 'hidden')
          seekBarINT()
          playB.onclick = function () {
            player.play()
            seek()
            togglePlayStyling('play')
            checkSongIndex()
          }
          pauseB.onclick = function () {
            player.pause()
            clearInterval(seekInterval)
            togglePlayStyling('pause')
            checkSongIndex()
          }
          prevB.onclick = function () {
            player.prev()
            clearSeek()
            seekInit()
            seek()
            getCurrentSong(function () {
              setSongTitle()
              togglePlayStyling('play')
              checkSongIndex()
              player.getCurrentSoundIndex(index => {
                selectCurrentTrack(index)
              })
            })
          }
          nextB.onclick = function () {
            player.next()
            clearSeek()
            seekInit()
            seek()
            getCurrentSong(function () {
              setSongTitle()
              togglePlayStyling('play')
              checkSongIndex()
              player.getCurrentSoundIndex(index => {
                selectCurrentTrack(index)
              })
            })
          }
        } else {
          hidePlayer()
        }
      })
    })
  }
}

//////////////////////////////////////////////////////// Initialize Slick slider
//------------------------------------------------------------------------------
function homeSlickINIT() {
  var slideModal = cE('slide-modal')[0]
  var twitterBgColour = E('twitter-bg-colour')
  var modalName = slideModal.getElementsByClassName('artist-name')[0]
  var taglineName = slideModal.getElementsByClassName('artist-tagline')[0]
  var hrefName = slideModal.getElementsByClassName('learn-more')[0]
  var timeout = null

  function hideSlideModal (next) {
    remC(slideModal, 'active')
    if (next) { next() }
  }

  function setSlide (slide) {
    timeout = setTimeout(function () {
      var container = slide.children[0]
      var name = gA(container, 'name')
      var tagline = gA(container, 'tagline')
      var href = gA(container, 'href')
      var colour = gA(container, 'colour')
      modalName.innerHTML = name
      taglineName.innerHTML = tagline
      hrefName.href = href
      twitterBgColour.style.backgroundColor = colour
      addC(slideModal, 'active')
    }, 150)
  }

  jQuery('#artists-slider').on('init', function (event, slick) {
    slideModal.appendChild(slick.$dots[0])
    setSlide(slick.$slides[slick.currentSlide])
  })

  jQuery('#artists-slider').on('beforeChange', function (event, slick, currentSlide, nextSlide) {
    hideSlideModal()
  })

  jQuery('#artists-slider').on('afterChange', function (event, slick, currentSlide) {
    setSlide(slick.$slides[currentSlide])
  })

  jQuery('#artists-slider').slick({
    arrows: false,
    dots: true,
    draggable: false
  })
}

