function songINT () {
  var songB = E('sound-bars')
  var iframe = E('homePlayerIframe')

  if (iframe) {
    var player = SC.Widget(iframe)
    var startTime = parseInt(gA(iframe, 'start-time')) * 1000
    var status = 'paused'
    var songLength = 0

    player.bind(SC.Widget.Events.READY, function() {
      player.getDuration(function (duration) {
        songLength = duration
        var interval = setInterval(function () {
          player.getPosition(function (pos) {
            if (pos > Math.floor(songLength - 200)) { player.seekTo(0) }
          })
        }, 100)
      })

      player.seekTo(startTime)

      songB.onclick = function () {
        if (status === 'paused') {
          player.setVolume(100)
          player.play({ onfinish: player.play() })
          remC(songB, 'mute')
          status = true
        } else if (status) {
          player.setVolume(0)
          addC(songB, 'mute')
          status = false
        } else {
          player.setVolume(100)
          remC(songB, 'mute')
          status = true
        }
      }
    })
  }
}

