function twitterSliderINIT () {
  var ticker = E('twitter-ticker')
  var name = cE('user-name')[0]
  var handle = cE('user-handle')[0]
  var track = cE('tweet-track')[0]

  function populateTicker(tweets) {
    var tweet = tweets[0]
    name.innerHTML = tweet.user.name
    handle.innerHTML = '@' + tweet.user.screen_name + ''
  }

  function buildSlider(tweets) {
    var compiledTweets = []
    for (var i = 0; i < tweets.length; i++) {
      var tweet = tweets[i]
      compiledTweets.push(tweet.text)
      compiledTweets.push(' | ')
    }
    track.innerHTML = compiledTweets.join('')
  }

  function engage () {
    jQuery.ajax({
      type: 'GET',
      url: '/material/views/goin-native/_ajax/twitter.php',
      success: function (data) {
        if (data.payload) { populateTicker(data.payload); buildSlider(data.payload) }
        else { ticker.style.display = 'none'; }
      },
      error: function (data) { ticker.style.display = 'none' }
    })
  }; engage()
}

function mailchimpFormINT () {
  var introSubscribeForm = jQuery('#intro-subscribe').find('form')
  var labelSubscribeForm = jQuery('#label-subscribe').find('form')

  function handleResponse (form, response) {
    var status = response.result
    var msg = response.msg
    var errorContainer = form.find('#mce-error-response')
    var successContainer = form.find('#mce-success-response')
    if (status === 'error') {
      if (msg.split(' - ')[1]) {
        errorContainer.text(msg.split(' - ')[1])
      } else {
        if (msg.indexOf('subscribed') !== -1) {
          errorContainer.html(msg.split(' <a')[0]).text()
        } else {
          errorContainer.text(msg)
        }
      }
      successContainer.removeClass('active')
      errorContainer.addClass('active')
    } else if (status === 'success') {
      if (msg.split(' - ')[1]) {
        successContainer.text(msg.split(' - ')[1])
      } else {
        successContainer.text(msg)
      }
      errorContainer.removeClass('active')
      successContainer.addClass('active')
    }
  }

  if (introSubscribeForm) {
    introSubscribeForm.ajaxChimp({
      callback: function (response) { handleResponse(introSubscribeForm, response) }
    })
  }
  if (labelSubscribeForm) {
    labelSubscribeForm.ajaxChimp({
      callback: function (response) { handleResponse(labelSubscribeForm, response) }
    })
  }
}

